import React from "react";
import './Home.css';
import bg from './bg.svg';
function Home(){
    return(
        <>
            <img className="bg" />
            <div className="abt">
                <span>What are we?</span>
                <div>Paytm is India's leading financial services company that offers full-stack payments & financial solutions to consumers, offline merchants and online platforms. The company is on a mission to bring half a billion Indians into the mainstream economy through payments, commerce, banking, investments, and financial services. One97 Communications Limited that owns the brand Paytm is founded by Vijay Shekhar Sharma and is headquartered in Noida, Uttar Pradesh. Its investors include Softbank, Ant Financial, AGH Holdings, SAIF Partners, Berkshire Hathaway,
T Rowe Price, and Discovery Capital.</div> 
            </div>

            <form className="form">
                <span>Login</span>
                <label className="username">username</label>
                <input type="email" placeholder="type your username" className="inp1"/>
                <label className="pswd">password</label>
                <input type="password" placeholder="type your password" className="inp2"/>
                <button class="cta">
                    <span>Log-in</span>
                    <svg width="15px" height="10px" viewBox="0 0 13 10">
                        <path d="M1,5 L11,5"></path>
                        <polyline points="8 1 12 5 8 9"></polyline>
                    </svg>
                </button>
            </form>

        </>
    );
}

export default Home;
